import {create} from '../api/index'

export const createUsers = (userData) =>async(dispatch)=>{
    alert("meow")
    try {
        console.log(userData)
        alert('abc')
        const {data} = await create(userData)
    } catch (error) {
        console.log(error)
    }
}
